package cprail.ptc.service.beans;

public class Dim {

	private String defs;
	private String cx;
	private String cy;
	
	
	public Dim() {
		super();
		// TODO Auto-generated constructor stub
	}


	public String getDefs() {
		return defs;
	}


	public void setDefs(String defs) {
		this.defs = defs;
	}


	public String getCx() {
		return cx;
	}


	public void setCx(String cx) {
		this.cx = cx;
	}


	public String getCy() {
		return cy;
	}


	public void setCy(String cy) {
		this.cy = cy;
	}
	
	
}
